import "./Expense.css";
import ExpenseItem from "./ExpenseItem";

function Expense(props) {
  return (
    <div className="expenses">
      <h2>Let's get started!</h2>
      <ExpenseItem
        title={props.title}
        amount={props.amount}
        date={props.date}
      />
      <ExpenseItem
        title={props.title}
        amount={props.amount}
        date={props.date}
      />
      <ExpenseItem
        title={props.title}
        amount={props.amount}
        date={props.date}
      />
      <ExpenseItem
        title={props.title}
        amount={props.amount}
        date={props.date}
      />
    </div>
  );
}

export default Expense;
